import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      price: null,
      url: ''

    };

    this.onGetStockPrice = this.onGetStockPrice.bind(this);
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);

  }

  handleChange(event) {
    this.setState({value: event.target.value});
  }

  handleSubmit(event) {
    alert('A name was submitted: ' + this.state.value);
    event.preventDefault();
  }

  onGetStockPrice() {
    const ticker = document.getElementsByClassName('App-searchbox');
    fetch('https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&symbol='+ this.state.url +'&interval=1min&apikey=VGDQ94ZG26OZZDFP', {
      method: 'GET',
      headers: {
        Accept: 'application/json'
      }
    })
      .then(response => response.json())
      .then(json => {
        this.setState({price: json['Time Series (1min)']});
      })
      .then(console.log(this.state.price))
      .then(console.log('operation completed'))
  }


  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />

          <form onSubmit={this.handleSubmit}>
            <label>
              <input type="text" value={this.state.url} onChange={this.handleChange} />
            </label>
            <input type="submit" value="Submit" />
          </form>


          <input
            className = 'App-searchbox'
            type="text"
            placeholder="Enter search ticker..."
            url = {this.state.url}
            onChange={this.handleChange}
          />
          <br></br>
          <button className = 'App-button' onClick={this.onGetStockPrice}>Today's Stock Price</button>
          <p className="App-info">{JSON.stringify(this.state.price)}</p>
        </header>
      </div>
    );
  }

}

export default App;
